" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Aluminum chloride hexahydrate: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?37/29/38355?source=see_link\">",
"    see \"Aluminum chloride hexahydrate: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F132429\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Certain Dri&reg; [OTC];",
"     </li>",
"     <li>",
"      Drysol&trade;;",
"     </li>",
"     <li>",
"      Hypercare&trade;;",
"     </li>",
"     <li>",
"      Xerac&trade; AC",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F132438\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Topical Skin Product",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F132430\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hyperhidrosis: Topical: Apply once daily at bedtime; once excessive sweating has stopped, may decrease to once or twice weekly, or as needed. Wash treated area in the morning.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F132431\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block dor drugH1Div\" id=\"F15671471\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Renal Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer&rsquo;s labeling.",
"    </p>",
"   </div>",
"   <div class=\"block doh drugH1Div\" id=\"F15671472\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Hepatic Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer&rsquo;s labeling.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F132421\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Certain Dri&reg;: 12% (36 mL) [ethanol free; roll-on]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Drysol&trade;: 20% (35 mL, 37.5 mL, 60 mL) [contains ethanol 93%]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Hypercare&trade;: 20% (35 mL, 37.5 mL, 60 mL) [contains ethanol 93%]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Xerac&trade; AC: 6.25% (35 mL, 60 mL) [contains ethanol 96%]",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F132412\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F132423\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Topical: Apply to dry skin. Area may be covered with plastic wrap held in place with snug-fitting T-shirt. Do not hold in place with tape.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F132422\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Astringent in the management of hyperhidrosis",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F132444\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Sound-alike/look-alike issues:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Drysol&trade; may be confused with Drisdol&reg;",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F132436\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Dermatologic: Skin irritation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Local: Burning sensation, prickling sensation, transient itching or stinging",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F132425\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to any component of the formulation",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F132415\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Concerns related to adverse effects:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Skin irritation: Discontinue if skin irritation occurs.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Appropriate use: For external use only; avoid contact with eyes. Do not apply to broken or recently shaved skin. May be harmful to certain metals or fabrics.",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13298720\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F6217758\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
